import React, {Component} from 'react';
export class MainPage extends Component{
    componentDidMount() {
        this.setState({ingridientsList:['sup', 'borsh', 'rasolnik']})
    }
    constructor(props){
        super(props);
        this.state = {
            ingridientsList:[]
        }
    }

    render(){
        console.log(this.state.ingridientsList)
        return(
           <div className='fpage'>
               <section className='group_header'>
                   <h1> Мои рецепты</h1>
               </section>
               <div>
                   <select>
                       {
                           this.state.ingridientsList.map(( item, index) => {
                              return (
                                  <option key={index}>{item}</option>
                              )
                           })
                       }
                   </select>
               </div>
           </div>

        )
    }
}
